import React from 'react';
import Button from 'react-bootstrap/Button'

export default class ShowAllCheckboxes extends React.Component {
  showAll() {
    return;
  }

  render() {
    return (
      <div id='show-all-div'>
        <Button id='show-all' onClick={ () => showAll() }>Show all checkboxes</Button>
      </div>
    );
  }
}
